import React from 'react';
import Sidebar from './Sidebar';
import InfoCard from './InfoCard';
import Calendar from './Calendar';
import PieChart from './PieChart';
import Table from './Table'; // Import the Table component
import { FaUsers, FaChalkboardTeacher, FaRoute, FaBuilding } from 'react-icons/fa';
import styles from './CoordinatorDashboardFeedbackAnalysis.module.css';

const DashboardFeedbackAnalysis = () => {
  // Info Card Data
  const infoCardsData = [
    {
      title: 'Advisors',
      value: 34,
      icon: <FaUsers />,
      bgColor: '#e0a800', // Gold
    },
    {
      title: 'Guides',
      value: 53,
      icon: <FaChalkboardTeacher />,
      bgColor: '#20c997', // Green
    },
    {
      title: 'Tours',
      value: 49,
      icon: <FaRoute />,
      bgColor: '#007bff', // Blue
    },
    {
      title: 'Fairs',
      value: 9,
      icon: <FaBuilding />,
      bgColor: '#6610f2', // Purple
    },
  ];

  return (
    <div className={styles.dashboardContainer}>
      {/* Sidebar */}
      <Sidebar />

      {/* Main Content */}
      <div className={styles.mainContent}>
        <h1 className={styles.dashboardTitle}>Feedback Analysis</h1>

        {/* Info Cards Section */}
        <div className={styles.infoCardsSection}>
          {infoCardsData.map((card, index) => (
            <InfoCard
              key={index}
              title={card.title}
              value={card.value}
              icon={card.icon}
              bgColor={card.bgColor}
            />
          ))}
        </div>

        {/* Calendar and Pie Chart Section */}
        <div className={styles.middleSection}>
          <div className={styles.calendarWrapper}>
            <Calendar />
          </div>
          <div className={styles.pieChartWrapper}>
            <PieChart />
          </div>
        </div>

        {/* Table Section */}
        <div className={styles.tableWrapper}>
          <Table />
        </div>
      </div>
    </div>
  );
};

export default DashboardFeedbackAnalysis;
